import React, { Component } from 'react'
import { makeStyles } from '@material-ui/core/styles';
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { createMuiTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core//Typography'
import red from '@material-ui/core/colors/red'
import Button from '@material-ui/core/Button'
import { Link } from 'react-router-dom';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';

const useStyles = makeStyles({
    card: {
      maxWidth: 345,
    },
    media: {
      height: 140,
    },
  });


const theme = createMuiTheme({
    palette: {
        primary: {
            main: red['A700']
        },
        secondary: {
            main: "#ffffff"
        }
    }
});

export class Home extends Component {
    render() {
        const classes = useStyles();
        return (
            <MuiThemeProvider theme={theme}>
                <React.Fragment>
                    <AppBar position="static" color="primary" >
                        <Toolbar >
                            <Typography variant="h5">
                                WebMenu
                            </Typography>
                            <Button id="logButton" variant="contained" color="primary" >
                                <Link className="link" to="/login" >Login</Link>
                            </Button>
                            <Button id="cadButton" variant="contained" color="secondary" >
                                <Link  className="linkCad" to="/cadastro" >Cadastre-se</Link>
                            </Button>
                        </Toolbar>
                    </AppBar>
                    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="./images/food.jpg"
          title="Food"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Food
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eleifend sagittis massa.
          Vestibulum pellentesque bibendum metus iaculis tincidunt.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
                </React.Fragment>
            </MuiThemeProvider>
        )

    }
}

export default Home
